import styled from 'styled-components'

const StyledSection = styled.section`
  /* margin: auto; */
  margin: 5.4rem 1.6rem;
  /* height: 500px; */
  width: ${props => props.theme.maxWidth};
`


const Section = props => (
  <StyledSection>
    {props.children}
  </StyledSection>
)

export default Section
